import axios from "axios";
import {instance} from '../index';

export const getChurchInfo = async () => {
  try {
    const response = await instance.get("administrators/churchs/info/");
    return response.data;
  } catch (error) {
    console.error(error);
  }
};

export const registPastor = async () => {
  try {
    const response = await instance.post("administrators/churchs/pastor/");
    return response.data;
  } catch (error) {
    console.error(error);
  }
};

export const patchChurchInfo = async (churchName:string, denominationName:string, contackNumber:string, introductionTitle:string, introductionContent:string, address:string, detailAddress:string) => {
    const formData = new FormData();
    formData.append('church_name', churchName);
    formData.append('denomination_name', denominationName);
    formData.append('contact_number', contackNumber);
    formData.append('introduction_title', introductionTitle);
    formData.append('introduction_content', introductionContent);
    formData.append('address', address);
    formData.append('detail_address', detailAddress);
  // formData.append('image', churchName, image.name);
    // formData.append('_method', 'PATCH');

  try {
    const response = await instance.patch("administrators/churchs/info/",formData);
    return response.data;
  } catch (error) {
    console.error(error);
  }
};
